import React from 'react';
import {Signup} from "./components/signup";
import Wave from "react-wavify";

function App() {
  return (
      <><Signup/><Wave fill='#f79902'
                       paused={false}
                       options={{
                         height: 100,
                         amplitude: 20,
                         speed: 0.35,
                         points: 3
                       }}/></>
  );
}

export default App;
